const getSessionsByUserId = `-- name: GetSessionsByUserId :many
SELECT session_id, user_id, created_at, expires_at, last_access, ip_address, user_agent, session_data FROM sessions
WHERE user_id = ?
`

func (q *Queries) GetSessionsByUserId(ctx context.Context, userID int64) ([]Sessions, error) {
	rows, err := q.db.QueryContext(ctx, getSessionsByUserId, userID)
	if err != nil {
		return nil, err
	}
	defer rows.Close()
	var items []Sessions
	for rows.Next() {
		var i Sessions
		if err := rows.Scan(
			&i.SessionID,
			&i.UserID,
			&i.CreatedAt,
			&i.ExpiresAt,
			&i.LastAccess,
			&i.IpAddress,
			&i.UserAgent,
			&i.SessionData,
		); err != nil {
			return nil, err
		}
		items = append(items, i)
	}
	if err := rows.Close(); err != nil {
		return nil, err
	}
	if err := rows.Err(); err != nil {
		return nil, err
	}
	return items, nil
}

